const Cv = ({tasks,seconds}) => {


  return (
    <>
    <div key={tasks.count} >
        <div className='name' >
            {tasks.text}
            </div>
            <div className='name'>
            {tasks.tel}
            </div>
            <div className='name'>
            {tasks.email} 
            </div>
            <div className='name'>
            {seconds.school}
            </div>
            <div className='name'>
            {seconds.title}
            </div>
            <div className='name'>
            {seconds.date}
            </div>
            <div className='name'>
            {seconds.finish}
            </div>
            {
      tasks.map((task) => {
        return (

        <ul style={{display:'flex',alignItems:'center',gap:'15px'}}
        key={task.count}>{task.count}. {task.text} 
        <FaTimes onClick={() =>deleteTask(task.count)}style={{color:'red'}} /> 
        <Button  color={'blue'} edit={'Hello'} /> </ul>

        )
      })}

    </div>


    </>
  );
};

export default Cv;
